tials: true, // must be before the setHeaders obj\n            setHeaders: {\n                'Cache-Control': 'no-cache, no-store, must-revalidate', \n                Pragma: 'no-cache',\n            }\n        });\n        return next.handle(authReq);\n    }\n\n\n    public apiUrl = 'http://localhost:5000/employees'\n\n    constructor(\n        private http: HttpClient,\n        private messageService: MessageService,\n        private confirmationService: ConfirmationService\n    ) { }\n\n    getEmployees(): Observable {\n        return this.http.get(this.apiUrl, httpOptions)\n    }\n\n    deleteEmployee(employee: Employee): Observable {\n        const url = `${this.apiUrl}/${employee.id}`;\n        this.confirmationService.confirm({\n            message: 'Are you sure you want to delete ?',\n            header: 'Confirm',\n            icon: 'pi pi-exclamation-triangle',\n            accept: () => {\n                this.messageService.add({ severity: 'success', summary: 'Successful', detail: `${employee.name} deleted`, life: 3000 })\n            }\n        })\n        return this.http.delete(url);\n    }\n\n    deleteMultiple(id: string) {\n        return this.http.delete(this.apiUrl + '/' + id)\n    }\n\n    editEmployee(employee: Employee): Observable {\n        const url = `${this.apiUrl}/${employee.id}`;\n        return this.http.put(url, employee, httpOptions);\n    }\n\n    addEmployee(employee: Employee): Observable {\n        return this.http.post(this.apiUrl, employee, httpOptions)\n    }\n\n    getRandomImage() :Observable {\n        return this.http.get('https://randomuser.me/api/?results=20', httpOptions)\n    }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/ExportExcelService.html":{"url":"injectables/ExportExcelService.html","title":"injectable - ExportExcelService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Inj